import React from 'react'

import { Helmet } from "react-helmet-async";

import Header from '../components/Header'
import Footer from '../components/Footer'

import { useAuthState } from "react-firebase-hooks/auth";
import { auth } from "../firebase/config";

import { useEffect } from "react";
import { useNavigate } from "react-router-dom";

import Moment from "react-moment";

const Profile = () => {

    const [user, loading, error] = useAuthState(auth);

    const navigate = useNavigate();

    useEffect(() => {
        if (!user) {
            navigate("/");
        }
    });

    return (

        <>

            {/* --------------------------------------------------------------------- */}

            <Helmet>
                <title>Profile</title>
                <meta name="description" content="Profile Page Description" />
                <style type="text/css">{` 
                    main{
                    flex-direction: column;
                    }
                    .delete{
                        margin-top: 25px;
                        background-color:  #dc3545;
                        padding: 0.375rem 0.75rem;
                        font-size: 1rem;
                        line-height: 1.5;
                        border-radius: 0.25rem;
                        border-color: #dc3545;
                    }
                `}</style>
            </Helmet>

            {/* --------------------------------------------------------------------- */}

            <Header />

            {/* --------------------------------------------------------------------- */}

            <main>

                <h6>UserName: {user.displayName}</h6>

                <h6>Email: {user.email}</h6>

                <h6> Last Sign-in : <Moment fromNow date={user.metadata.lastSignInTime} /> </h6>

                <h6> Account Created : {user.metadata.creationTime} </h6>

            </main>

            {/* --------------------------------------------------------------------- */}

            <Footer />

            {/* --------------------------------------------------------------------- */}

        </>

    )

}

export default Profile;
